problem:
Given the following pseudo-code:
```
a=3; 
b=-5; 
c=8; 
a=b; 
b=c; 
c=a; 
```
What is the output of the print statement `Print(“%d %d %d”, a, b, c)`? Express your answer as three integer values separated by commas.

Define the sets M and N as follows:
M = {u | u = 12m + 8n + 4l, m, n, l in Z}
N = {u | u = 20p + 16q + 12r, p, q, r in Z}
Describe the relationship between sets M and N using standard set notation and terminology.
